import React from "react";
import Course from "./Course";
import { Typography } from "@material-ui/core";

export default function CourseList(props) {
  const article = props.map((prop) => (
    <Typography variant={"body2"}>prop.abstract</Typography>
  ));
  console.log(article);
  return (
    <div>
      <Course abstract={article} />
    </div>
  );
}
